#Explique a principal semelhança e a principal diferença entre os comandos psutil.pids e psutil.process_iter.

print('Psutil.pids lista todos os processos que estão sendo executados na máquina, também é possível localizar um processo específico pelo PID.O comando psutil.process_iter'
      ' também lista os processos que estão sendo executados na máquina, a diferença está na forma como é implementada, de modo que seja mais eficiente quando executado repetidamente (em iterações).')